import React from 'react'
import logo from './logo.png'; 

export default function PageText() {
    const styles= {
        mainHeader: {
            color: 'black',
            paddingLeft: 100,
            paddingTop: 20,
        }, 

        logoStyle: {
            color: 'black',
            paddingLeft: 100,
            paddingTop: 50,
        }, 

        b: {
            color: 'green',
        }
    };

  return (
    <>
        <img src={logo} width={50} height={50} style={styles.logoStyle} alt="we care." />
        <h1 style={styles.mainHeader}>tell us something about you mental health.</h1>
    </>
  )
}
